#include <stdbool.h>
#include <stdlib.h>

#define MOD 1000000007

int primeScore(int n) {
    int score = 0;
    for (int i = 2; i*i <= n; i++) {
        if (n % i == 0) {
            score++;
            while (n % i == 0) n /= i;
        }
    }
    if (n > 1) score++;
    return score;
}

int compare(const void *a, const void *b) {
    return (*(int*)b) - (*(int*)a);
}

int maximumScore(int* nums, int numsSize, int k) {
    long long score = 1;
    int* scores = (int*)malloc(sizeof(int) * numsSize);
    for (int i = 0; i < numsSize; i++) {
        scores[i] = primeScore(nums[i]);
    }

    int* values = (int*)malloc(sizeof(int) * numsSize);
    for (int i = 0; i < numsSize; i++) {
        values[i] = nums[i];
    }

    qsort(values, numsSize, sizeof(int), compare);

    for (int i = 0; i < k; i++) {
        score = (score * values[i]) % MOD;
    }

    free(scores);
    free(values);

    return (int)score;
}
